import React, { useState } from 'react';
import { Form, Input, Button, Upload, message, Row, Col, DatePicker, Layout } from 'antd';
import { UploadOutlined } from '@ant-design/icons';



const { Header } = Layout;

const RegRow = () => {

    const nombres = localStorage.getItem('nombre');
    const token = localStorage.getItem('token');

    const [form] = Form.useForm();
    const [fileList, setFileList] = useState([]);
    const [pdfFileList, setPdfFileList] = useState([]);

    const onFinish = async (values) => {

        const formData = new FormData();
        
        formData.append('AjustadorQueRegistra', nombres); // Cambiar 'nombre' a 'Nombre'
        formData.append('Numero_Siniestro', values.Numero_Siniestro); // Cambiar 'correo' a 'Correo'
        formData.append('Folio_Edua', values.Folio_Edua); // Cambiar 'correo' a 'Correo'
        formData.append('Fecha_Ocurrido', values.Fecha_Ocurrido); // Cambiar 'correo' a 'Correo'
        formData.append('Fecha_Atencion', values.Fecha_Atencion); // Cambiar 'correo' a 'Correo'
        formData.append('Numero_Poliza', values.Numero_Poliza); // Cambiar 'correo' a 'Correo'
        formData.append('Serie_Vin', values.correo); // Cambiar 'correo' a 'Correo'
        formData.append('Placa_Vehiculo', values.Placa_Vehiculo); // Cambiar 'correo' a 'Correo'
        formData.append('Estado', values.Estado); // Cambiar 'correo' a 'Correo'
        formData.append('Ciudad', values.Ciudad); // Cambiar 'correo' a 'Correo'
        formData.append('Estado', values.Estado); // Cambiar 'correo' a 'Correo'


        if (values.PDF && values.PDF.length > 0) { // Cambiar 'pdf' a 'PDF'
            formData.append('PDF', values.PDF[0].originFileObj); // Cambiar 'pdf' a 'PDF'
        }

        try {
            const response = await fetch('http://localhost:8000/Siniestros/RegistrarSiniestro', {
                method: 'POST',
                body: formData,
                headers: {
                    'Authorization': token,
                    'Content-Type': 'multipart/form-data',  // Use multipart/form-data for file uploads
                 }
            });
            console.log("Datos", formData);
            if (!response.ok) {
                throw new Error('Error en el servidor');
            }

            message.success('Usuario registrado correctamente');
            form.resetFields();
            setFileList([]);
            setPdfFileList([]);
        } catch (error) {
            console.error('Error:', error.message);
            message.error('Hubo un error al procesar la solicitud');
        }
    };

    const onFinishFailed = (errorInfo) => {
        console.error('Failed:', errorInfo);
    };

    const normFile = (e) => {
        if (Array.isArray(e)) {
            return e;
        }
        return e && e.fileList;
    };

    const uploadProps = {
        onRemove: (file) => {
            setFileList((prevList) => prevList.filter((item) => item.uid !== file.uid));
        },
        beforeUpload: (file) => {
            setFileList((prevList) => [...prevList, file]);
            return false;
        },
        fileList,
    };

    const pdfUploadProps = {
        onRemove: (file) => {
            setPdfFileList((prevList) => prevList.filter((item) => item.uid !== file.uid));
        },
        beforeUpload: (file) => {
            setPdfFileList((prevList) => [...prevList, file]);
            return false;
        },
        fileList: pdfFileList,
    };

    return (
        <div style={{ backgroundColor: '#4174E0', padding: '20px', borderRadius: '8px', textAlign: 'center' }}>
        <Header style={{ backgroundColor: 'black', textAlign: 'center', paddingBottom: '2rem', borderRadius: '10px', marginBottom: '1rem', width: '100%' }}>
            <h1 className="title">Datos generales del siniestro</h1>
       </Header>
        <div style={{ textAlign: 'center', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%', marginTop: '2rem', marginBottom: '2rem' }}>
            <img src="https://cdn-icons-png.flaticon.com/256/12125/12125514.png" style={{ maxHeight: '200px' }} alt="Imagen de registro de siniestro" />
        </div>
        <div className="circle-background" style={{ position: 'absolute', marginTop: '-90px', marginLeft: '-25px' }}></div>
             <div style={{ backgroundColor: '#5995E1', borderRadius: '20px', padding: '1rem', boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)' }}>
             <Form
             layout='vertical'
            form={form}
            name="basic"
            initialValues={{ remember: true }}
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}
        >
                     <Row gutter={16}>
                         <Col xs={24} md={12}>
                             <Form.Item name="Numero_Siniestro" label="Número de Siniestro" rules={[{ required: true, message: 'Por favor ingresa el número de siniestro' }]}>
                                 <Input />
                             </Form.Item>
                         </Col>
                         <Col xs={24} md={12}>
                             <Form.Item name="Folio_Edua" label="Folio EDUA" rules={[{ required: true, message: 'Por favor ingresa el folio EDUA' }]}>
                                 <Input />
                             </Form.Item>
                         </Col>
                     </Row>
                     <Row gutter={16}>
                         <Col xs={24} md={12}>
                             <Form.Item name="Fecha_Ocurrido" label="Fecha de Ocurrido" rules={[{ required: true, message: 'Por favor selecciona la fecha de ocurrencia' }]}>
                                 <DatePicker format="YYYY-MM-DD" style={{ width: '100%' }} />
                             </Form.Item>
                         </Col>
                         <Col xs={24} md={12}>
                             <Form.Item name="Fecha_Atencion" label="Fecha de Atención" rules={[{ required: true, message: 'Por favor selecciona la fecha de atención' }]}>
                                 <DatePicker format="YYYY-MM-DD" style={{ width: '100%' }} />
                             </Form.Item>
                         </Col>
                     </Row>
                     <Row gutter={16}>
                         <Col xs={24} md={12}>
                             <Form.Item name="Numero_Poliza" label="Número de Póliza" rules={[{ required: true, message: 'Por favor ingresa el número de póliza' }]}>
                                 <Input />
                             </Form.Item>
                         </Col>
                         <Col xs={24} md={12}>
                             <Form.Item name="Serie_Vin" label="Serie VIN" rules={[{ required: true, message: 'Por favor ingresa la serie VIN' }]}>
                                 <Input />
                             </Form.Item>
                         </Col>
                     </Row>
                     <Row gutter={16}>
                         <Col xs={24} md={12}>
                             <Form.Item name="Placa_Vehiculo" label="Placa del Vehículo" rules={[{ required: true, message: 'Por favor ingresa la placa del vehículo' }]}>
                                 <Input />
                             </Form.Item>
                         </Col>
                         <Col xs={24} md={12}>
                             <Form.Item name="Estado" label="Estado" rules={[{ required: true, message: 'Por favor ingresa el estado' }]}>
                                 <Input />
                             </Form.Item>
                         </Col>
                     </Row>
                     <Row gutter={16}>
                         <Col xs={24}>
                             <Form.Item name="Ciudad" label="Ciudad" rules={[{ required: true, message: 'Por favor ingresa la ciudad' }]}>
                                 <Input />
                             </Form.Item>
                         </Col>
                     </Row>
                     <Row gutter={16}>
                         <Col xs={24}>
                         <Form.Item
                label="PDF"
                name="PDF"
                valuePropName="fileList"
                getValueFromEvent={normFile}
            >
                <Upload {...pdfUploadProps}>
                    <Button icon={<UploadOutlined />}>Seleccionar PDF</Button>
                </Upload>
            </Form.Item>
                         </Col>
                     </Row>
                     <Row gutter={16}>
                         <Col xs={24}>
                             <Form.Item>
                                 <Button type="primary" htmlType="submit" style={{ width: '100%', boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)' }}>
                                     Registrar Siniestro
                                 </Button>
                             </Form.Item>
                         </Col>
                     </Row>
                 </Form>
             </div>
             <br />
             <br />
             <br />
         </div>
    );
};

export default RegRow;
